import COMP from "./abis/COMP.json";
import cBAT from "./abis/cBAT.json";
import cDAI from "./abis/cDAI.json";
import cETH from "./abis/cETH.json";
import cREP from "./abis/cREP.json";
import cSAI from "./abis/cSAI.json";
import cUSDC from "./abis/cUSDC.json";
import cUSDT from "./abis/cUSDT.json";
import cWBTC from "./abis/cWBTC.json";
import cZRX from "./abis/cZRX.json";
import comptroller from "./abis/comptroller.json";
import governance from "./abis/governance.json";
import priceOracle from "./abis/priceOracle.json";
import timelock from "./abis/timelock.json";

export default {
  comptroller,
  governance,
  priceOracle,
  timelock,
  tokens: {
    COMP,
    cBAT,
    cDAI,
    cETH,
    cREP,
    cSAI,
    cUSDC,
    cUSDT,
    cWBTC,
    cZRX,
  },
};
